Install as a Docker Container. docker pull FenixAlliance.ABS:latest Install as an Application Extension There are certain cases where customers prefer to install the Alliance Business Suite so that they can extend the standard functionalities, create modules, integrations, SPAs, or really, any kind of extensions without having to worry about all the required wiring for it to work properly. In these cases, the best approach is to install the Alliance Business Suite as an application extension into a new or existing ASP.NET Application. To do this: Add the NuGet package dotnet add package FenixAlliance.ABS.Hub --version latest Register Services and Configuration using FenixAlliance.ABS.Hub.Extensions;
using Microsoft.AspNetCore.Builder;
using Microsoft.AspNetCore.Hosting.Server.Features;
using Microsoft.Extensions.Configuration;
using Microsoft.Extensions.DependencyInjection;
using Microsoft.Extensions.Hosting;
using System; namespace FenixAlliance.ABS
{ public class Startup { public IHostEnvironment Environment { get; set; } public IConfiguration Configuration { get; set; } // Constructor public Startup(IConfiguration Configuration, IHostEnvironment Environment) { this.Environment = Environment; this.Configuration = Configuration; } // This method gets called by the runtime. Use this method to add services to the container. public void ConfigureServices(IServiceCollection services) { services.AddAllianceBusinessSuite(Configuration, Environment); } // This method gets called by the runtime. Use this method to configure the HTTP request pipeline. public void Configure(IApplicationBuilder app) { app.UseAllianceBusinessSuite(Configuration, Environment); } }
